import React from "react";
import './aboutus.css';

const Aboutus = () => {
    return (
        <div  className="ccs__about section__about section__padding">
            About the Shop
        <div className="ccs_about-container">
        Max is a second generation hairdresser and barber. He graduated from cosmetology school in 1978. Max worked and managed many family salons and in 1984 opened Bozeman Beauty College on the campus of Montana State University. In 1990, he took over Mr. Mack's Beauty College and renamed it Max's Bozeman Beauty College. Sadly, he had to close it in 2000.  

After a while away from the college, he went to work with his father, Mack, at Mack's & Max's Barbershop. 

In April 2019, Max bought Hair Affair and re-branded it as Max's Barber and Hair Affair. 

Not only can Max do a great man's haircut, but he can also do perms, sets, colors, and blow styling.
        </div>
        </div>
        
        
    )
}
export default Aboutus
